function edtittext(){

setTimeout(function(){
	
var iframe = document.querySelector("#special_content_ifr");
var innerDoc = iframe.contentDocument || iframe.contentWindow.document;


innerDoc.body.innerHTML=document.querySelector(".ctext").innerHTML;
   
   
const targetNode = innerDoc.body;

console.log(targetNode);

// Options for the observer (which mutations to observe)
const config = { attributes: true, childList: true, subtree: true };

// Callback function to execute when mutations are observed
const callback = function(mutationsList, observer) {
    // Use traditional 'for loops' for IE 11
    for(let mutation of mutationsList) {
        if (mutation.type === 'childList') {
            console.log('A child node has been added or removed.');
	
document.querySelector(".ctext").innerHTML=innerDoc.body.innerHTML;


        }
        else if (mutation.type === 'attributes') {
		
document.querySelector(".ctext").innerHTML=innerDoc.body.innerHTML;

        }
    }
};

// Create an observer instance linked to the callback function
const observer = new MutationObserver(callback);

// Start observing the target node for configured mutations
observer.observe(targetNode, config);
innerDoc.body.addEventListener("input", updatecontentc, false);
innerDoc.body.addEventListener("change", updatecontentc, false);
//innerDoc.body.select();
document.querySelector("#mceu_12-button").click();

	
	}, 1000);
	
	
}


	

