function updatecolortrans(event){
var panel = document.querySelector(".panel-wappaa");
var cl=panel.style.backgroundColor;
var psiq = cl.lastIndexOf(",");
var temp=cl.substr(0, psiq);
temp=temp+","+event.target.value/100 + ")";
document.querySelector('#opaval').textContent=(event.target.value/100);
panel.style.backgroundColor=''+temp;

}

function rgb(v){
var opacity = 1;
return "rgba(" + v.match(/[A-Za-z0-9]{2}/g).map(function(v) { return parseInt(v, 16) }).join(",") + "," + opacity +")";
}
function rgba(v){
var opacity = document.querySelector("#opa").value;
opacity=opacity/100;
return "rgba(" + v.match(/[A-Za-z0-9]{2}/g).map(function(v) { return parseInt(v, 16) }).join(",") + "," + opacity +")";
}

