document.body.addEventListener('click', function (evt) {
if (evt.target===undefined) return;
var generalAction=evt.target.attributes["name"];
if (generalAction===undefined) return;
    if (generalAction.value === 'pos') {
        topbottom(document.querySelector('input[name="pos"]:checked').value);
    }
	if (generalAction.value === 'rtlt') {
		ltrrtl(document.querySelector('input[name="rtlt"]:checked').value);
    }
	if (generalAction.value === 'poweredby') {
		if(document.querySelector('input[name="poweredby"]:checked').value=="yes"){
		    document.querySelector("#poweredbylink").style.display='block';
		}
		else{
			document.querySelector("#poweredbylink").style.display='none'
		}
    }
}, false);





